import { useEffect, useState } from 'react'
import MenuList from './components/menu-list/MenuList'
import NavBar from './components/navbar/navbar'

function App () {
  const [state, setState] = useState(false)
  const newCartItem = () => {
    setState(true)
  }
  useEffect(() => {
    setState(false)
  }, [newCartItem])
  return (
    <div>
      <NavBar />
      <MenuList onNewAdd={newCartItem} />
    </div>
  )
}

export default App
